import React from 'react';
import './Navbar.css'
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="header">
    <div className="logo">
      {/* Replace with your logo image */}
      <img src="your-logo.png" alt="Agro-Buddy Logo" />
    </div>
    <nav>
      <ul>
        <button>Check Soil Compatibility</button>
        <button>Check Crop Compatibility</button>
        <button>Weather Forecast</button>
        <button><Link to='Chatbot'>Chatbot</Link></button>
        <button>Contact & Support</button>
      </ul>
    </nav>
  </header>

  );
};

export default Navbar;
